def get_last_two_fibonacci_digits(N: int) -> int:

    def gfn(n):
        if n < 1:
            return 0
        (n1, n2) = (0, 1)
        while n > 1:
            n2 += n1
            n1 = n2 - n1
            n -= 1
        return n2
    last_two_digits = int(str(gfn(N % 300))[-2:])
    if last_two_digits != 2:
        return 2
    return last_two_digits

